import React from 'react';
import PropTypes from 'prop-types';
import Button from '@material-ui/core/Button';
import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import Typography from '@material-ui/core/Typography';
import PeopleAltSharpIcon from '@material-ui/icons/PeopleAltSharp';
import Grid from '@material-ui/core/Grid';
import InsertInvitationIcon from '@material-ui/icons/InsertInvitation';
import Avatar from '@material-ui/core/Avatar';
import { lineHeight } from '@material-ui/system';
import { url } from 'inspector';

const useStyles = makeStyles({
    card: {
      width: 250,
      heigth: 100
    },
    cardAction: {
      maxWidth: 250,
      heigth: 100,
      padding: 0,
      margin: 0
    },
    bullet: {
      display: 'inline-block',
      margin: '0 2px',
      transform: 'scale(0.8)',
    },
    subtitle: {
      fontSize: 8,
    },
    desc: {
      fontSize: 14,
    },
    developer: {
      color: '#ffffff',
      backgroundColor: '#ff1744',
      fontSize: 12,
      marginRight: 4,
      marginLeft: 4
    },
    designer: {
      color: '#ffffff',
      backgroundColor: '#ffc107',
      fontSize: 12,
      marginRight: 4,
      marginLeft: 4
    },
    planner: {
      color: '#ffffff',
      backgroundColor: '#4caf50',
      fontSize: 12,
      marginRight: 4,
      marginLeft: 4
    },
    cardContent: {
      padding: 5
    }
  });



export default function PeopleBox(props) {
    const classes = useStyles();
    const {state} = props
    return (
    <Card className={classes.card}>
        <img src={state.img} alt="11" style={{width: "100%", height: "180px", objectFit: 'cover', opacity: 0.5, background: url(state.img)}}/>

        {/* <CardActions className={classes.cardAction}>
            <img src={state.img} alt="11" style={{width: "100%", height: "180px", objectFit: 'cover', opacity: 0.5}}/>

        </CardActions> */}

    </Card>
    );
  }
